import React from 'react';
import "./navbar.css";
import { BrowserRouter as Router } from 'react-router-dom'; 
import {
  Nav,
  NavLink,
  Bars,
  NavMenu,
  NavBtn,
//   NavBtnLink,
} from './NavbarElements';

import {useHistory} from 'react-router-dom'




const Navbar= () => {
    const history = useHistory();

   const toProfile = (e) => {
    console.log('to profile');
    e.preventDefault();
    history.push('/Profile');
}
 const toHome = (e) => {
    console.log('to home');
    e.preventDefault();
    history.push('/');
}

//   const loginSubmitForm = (e) => {
//     console.log('login');
//     e.preventDefault();
//     history.push('/Chatroom');
//   }


    return (
        <>
        <Router>
        <Nav>
             <p className = "logo">Yearbook</p>
            <Bars />
            <NavMenu>
                <NavLink to = "/profile" activeStyle onClick={toProfile} >
                    <p className = "nav-items"> Profile</p>

                </NavLink>
                <NavLink to = "/settings" activeStyle>
                   <p className = "nav-items"> Settings </p>

                </NavLink>
                <NavLink to = "/" activeStyle onClick={toHome}>
                  <p className = "nav-items"> sign out </p>

                </NavLink>
            </NavMenu>
        </Nav>
        </Router>
        </>
    )
}

export default Navbar;
